        kk6*mm11*nn4 - kk6*mm4*nn11 + kk7*mm11*nn3 - kk7*mm3*nn11 + kk8*mm11*nn2 - kk8*mm2*nn11
    coef3=- kk1*mm13*nn8 + kk1*mm8*nn13 + kk13*mm1*nn8 + kk13*mm2*nn7 + kk13*mm3*nn6 + kk13*mm4*nn5-...
        kk13*mm5*nn4 - kk13*mm6*nn3 - kk13*mm7*nn2 - kk13*mm8*nn1 - kk2*mm13*nn7 + kk2*mm7*nn13- ...
        kk3*mm13*nn6 + kk3*mm6*nn13 - kk4*mm13*nn5 + kk4*mm5*nn13 + kk5*mm13*nn4 - kk5*mm4*nn13+ ...
        kk6*mm13*nn3 - kk6*mm3*nn13 + kk7*mm13*nn2 - kk7*mm2*nn13 - kk8*mm1*nn13 + kk8*mm13*nn1+ ...
        kk12*mm2*nn8 + kk12*mm3*nn7 + kk12*mm4*nn6 - kk12*mm6*nn4 - kk12*mm7*nn3 - kk12*mm8*nn2 - ...
        kk2*mm12*nn8 + kk2*mm8*nn12 - kk3*mm12*nn7 + kk3*mm7*nn12 - kk4*mm12*nn6 + kk4*mm6*nn12+ ...
        kk6*mm12*nn4 - kk6*mm4*nn12 + kk7*mm12*nn3 - kk7*mm3*nn12 + kk8*mm12*nn2 - kk8*mm2*nn12+...
        kk11*mm3*nn8 + kk11*mm4*nn7 - kk11*mm7*nn4 - kk11*mm8*nn3 - kk3*mm11*nn8 + kk3*mm8*nn11- ...
        kk4*mm11*nn7 + kk4*mm7*nn11 + kk7*mm11*nn4 - kk7*mm4*nn11 + kk8*mm11*nn3 - kk8*mm3*nn11+ ...
        kk10*mm4*nn8 - kk10*mm8*nn4 - kk4*mm10*nn8 + kk4*mm8*nn10 + kk8*mm10*nn4 - kk8*mm4*nn10
    coef2=+ kk13*mm2*nn8 + kk13*mm3*nn7 + kk13*mm4*nn6 - kk13*mm6*nn4 - kk13*mm7*nn3 - kk13*mm8*nn2-...
        kk2*mm13*nn8 + kk2*mm8*nn13 - kk3*mm13*nn7 + kk3*mm7*nn13 - kk4*mm13*nn6 + kk4*mm6*nn13+...
        kk6*mm13*nn4 - kk6*mm4*nn13 + kk7*mm13*nn3 - kk7*mm3*nn13 + kk8*mm13*nn2 - kk8*mm2*nn13+ ...
        kk12*mm3*nn8 + kk12*mm4*nn7 - kk12*mm7*nn4 - kk12*mm8*nn3 - kk3*mm12*nn8 + kk3*mm8*nn12-...
        kk4*mm12*nn7 + kk4*mm7*nn12 + kk7*mm12*nn4 - kk7*mm4*nn12 + kk8*mm12*nn3 - kk8*mm3*nn12+ ...
        kk11*mm4*nn8 - kk11*mm8*nn4 - kk4*mm11*nn8 + kk4*mm8*nn11 + kk8*mm11*nn4 - kk8*mm4*nn11
    coef1=+ kk13*mm3*nn8 + kk13*mm4*nn7 - kk13*mm7*nn4 - kk13*mm8*nn3 - kk3*mm13*nn8 + kk3*mm8*nn13- ...
        kk4*mm13*nn7 + kk4*mm7*nn13 + kk7*mm13*nn4 - kk7*mm4*nn13 + kk8*mm13*nn3 - kk8*mm3*nn13+ ...
        kk12*mm4*nn8 - kk12*mm8*nn4 - kk4*mm12*nn8 + kk4*mm8*nn12 + kk8*mm12*nn4 - kk8*mm4*nn12
    coef0=kk13*mm4*nn8 - kk13*mm8*nn4 - kk4*mm13*nn8 + kk4*mm8*nn13 + kk8*mm13*nn4 - kk8*mm4*nn13;
    coef=[coef10,coef9,coef8,coef7,coef6,coef5,coef4,coef3,coef2,coef1,coef0];
    c_value=roots(coef);

%     rotation_matrix_origin= [ 0.6424    0.7656   -0.0349
%                            -0.7648    0.6433    0.0349
%                             0.0492    0.0043    0.9988]
                        
%     Translation_vector_origin =[ 0.0175    0.0174    0.9997]
Translation_matrix_origin=[0,-Translation_vector_origin(3),Translation_vector_origin(2);Translation_vector_origin(3),0,-Translation_vector_origin(1);...
        -Translation_vector_origin(2),Translation_vector_origin(1),0];
essential_origin=Translation_matrix_origin*rotation_matrix_origin;
%         essential_origin=[ 0.7654   -0.6431   -0.0174
%                        0.6413    0.7653   -0.0523
%                       -0.0246   -0.0021    0.0012];
    for c_index=1:10
        if isreal(c_value(c_index))
            C=c_value(c_index);
            M5=[kk1*C^3+kk2*C^2+kk3*C+kk4,kk5*C^3+kk6*C^2+kk7*C+kk8,kk9*C^4+kk10*C^3+kk11*C^2+kk12*C+kk13;
                mm1*C^3+mm2*C^2+mm3*C+mm4,mm5*C^3+mm6*C^2+mm7*C+mm8,mm9*C^4+mm10*C^3+mm11*C^2+mm12*C+mm13;
                nn1*C^3+nn2*C^2+nn3*C+nn4,nn5*C^3+nn6*C^2+nn7*C+nn8,nn9*C^4+nn10*C^3+nn11*C^2+nn12*C+nn13;];
            A=(M5(1,2)*M5(2,3)-M5(1,3)*M5(2,2))/(M5(1,1)*M5(2,2)-M5(1,2)*M5(2,1));
            B=(M5(1,3)*M5(2,1)-M5(1,1)*M5(2,3))/(M5(1,1)*M5(2,2)-M5(1,2)*M5(2,1));

            essential_point5_normalized=A*X_matrix+B*Y_matrix+C*Z_matrix+W_matrix;
            essential_point5_normalized=sqrt(2)*essential_point5_normalized/sqrt(sum(sum(essential_point5_normalized.*essential_point5_normalized)));
            
            rididual_essential1=sqrt(sum(sum((essential_origin/sqrt(sum(sum(essential_origin.^2)))-essential_point5_normalized/sqrt(sum(sum(essential_point5_normalized.^2)))).^2)));
            rididual_essential2=sqrt(sum(sum((essential_origin/sqrt(sum(sum(essential_origin.^2)))+essential_point5_normalized/sqrt(sum(sum(essential_point5_normalized.^2)))).^2)));
            rididual_essential(c_index)=min(rididual_essential1,rididual_essential2);
            testvector=[A^3,B^3,A^2*B,A*B^2,A^2*C,A^2,B^2*C,B^2,A*B*C,A*B,A*C^2,A*C,A,B*C^2,B*C,B,C^3,C^2,C,1];
            residual=Matrix_a1*testvector';
            index_valide=find(rididual_essential>0);
            if rididual_essential(c_index)==min(rididual_essential(index_valide))
                F_return_point5_normalized=essential_point5_normalized;
            end            
        end        
    end
    [U_translation,S_translation,V_translation]=svd(F_return_point5_normalized);
    matrix_T_sig1=[0 -1 0;1 0 0;0 0 0];
    matrix_R_sig1=[0 1 0;-1 0 0;0 0 1];
    Rotation_5point1=U_translation*matrix_R_sig1*V_translation';
    Translation_5point1=U_translation*matrix_T_sig1*U_translation';
    matrix_T_sig2=[0 1 0;-1 0 0;0 0 0];
    matrix_R_sig2=[0 -1 0;1 0 0;0 0 1];
    Rotation_5point2=U_translation*matrix_R_sig2*V_translation';
    Translation_5point2=U_translation*matrix_T_sig2*U_translation';
    %要注意这里给出的旋转矩阵和平移矩阵是在相差一个符号的基础上相等的，所以需要分开判断方向，否者要乘以一个-1；
    Translation_vector_5point1=[-Translation_5point1(2,3),Translation_5point1(1,3),-Translation_5point1(1,2)];
    Is_T_direction_correct1=sum(Translation_vector_origin.*Translation_vector_5point1);
    Is_R_direction_correct1=det(rotation_matrix_origin'*Rotation_5point1);
    if Is_T_direction_correct1<0
        Translation_vector_5point1=-Translation_vector_5point1;
    end
    if Is_R_direction_correct1<0
        Rotation_5point1=-Rotation_5point1;
    end
    %       essential_origin=[ 0.7654   -0.6431   -0.0174
%                        0.6413    0.7653   -0.0523
%                       -0.0246   -0.0021    0.0012];
%     rotation_matrix_origin= [ 0.6424    0.7656   -0.0349
%                            -0.7648    0.6433    0.0349
%                             0.0492    0.0043    0.9988]
%                         
%     Translation_vector_origin =[ 0.0175    0.0174    0.9997]
    Translation_vector_5point2=[-Translation_5point2(2,3),Translation_5point2(1,3),-Translation_5point2(1,2)];
    Is_T_direction_correct2=sum(Translation_vector_origin.*Translation_vector_5point2);
    Is_R_direction_correct2=det(rotation_matrix_origin'*Rotation_5point2);
    if Is_T_direction_correct2<0
        Translation_vector_5point2=-Translation_vector_5point2;
    end
    if Is_R_direction_correct2<0
        Rotation_5point2=-Rotation_5point2;
    end


    distance_rotation_5point1=Rotation_5point1'*rotation_matrix_origin;
    distance_translation_5point1=acos(Translation_vector_5point1*Translation_vector_origin');
    distance_rotation_5point2=Rotation_5point2'*rotation_matrix_origin;
    distance_translation_5point2=acos(Translation_vector_5point2*Translation_vector_origin');
     

    deviation_rotation_matrix_5p=min(sum(sum((distance_rotation_5point1-eye(3)).^2)),sum(sum((distance_rotation_5point2-eye(3)).^2)));
    deviation_translation_matrix_5p=min(distance_translation_5point1,distance_translation_5point2);
    %essentikkl_mkktrix=X_mkktrix+Y_mkktrix+Z_mkktrix+W_mkktrix
    %     [0.7654   -0.6431   -0.0174
    %     0.6413    0.7653   -0.0523
    %    -0.0246   -0.0021    0.0012]
    
end



